  if n = 0 then 0
  else (Finset.range (n + 1)).filter (λ d, d ∣ n ∧ d % 2 = 1).max' (by simp [zero_lt_one])

def greatestOddDivisor (n : ℕ) : ℕ :=
  Finset.max' (Finset.filter (λ d, d ∣ n ∧ d % 2 = 1) (Finset.range (n + 1))) (begin
    use 1,
    simp [Nat.one_dvd]
